                    fg.AppendLine($"Flags => {item.Flags}");
                }
                if (printMask?.ClassServices ?? true)
                {
                    fg.AppendLine($"ClassServices => {item.ClassServices}");
                }
                if (printMask?.Training?.Overall ?? true)
                {
                    item.Training?.ToString(fg, "Training");
                }
            }
            fg.AppendLine("]");
        }

